import React from 'react';

const Jumbotron = () => {
    return (
            <div class="jumbotron text-center">
                <h1 class="display-4">Google Books Search</h1>
                <p class="lead">Find the Books you Love</p>
            </div>
    )
}

export default Jumbotron;
